import pickle
from nltk.translate.bleu_score import sentence_bleu
from nltk.translate.bleu_score import SmoothingFunction
import re


def get_bleu_ave(pred, target):
    turns = len(target)
    bleu_ave = 0
    for index in range(turns):
        pred_utt = pred[index]
        target_utt = target[index]
        min_len = min(len(pred_utt), len(target_utt))
        if min_len >= 4:
            bleu_ave_utt = sentence_bleu([target_utt], pred_utt, weights=(0.25, 0.25, 0.25, 0.25),
                                         smoothing_function=SmoothingFunction().method7)
        else:
            bleu_ave_utt = 0
        bleu_ave += bleu_ave_utt
    bleu_ave /= turns
    return bleu_ave


def get_youyin(sentence):
    aa = "(吃早饭|吃饭规律|三餐规律|饮食规律|作息规律|辣|油炸|熬夜|豆类|油腻|生冷|煎炸|浓茶|喝酒|抽烟|吃的多|暴饮暴食|不容易消化的食物|情绪稳定|精神紧张|夜宵).*?(吗|啊？|呢？|么|嘛？)"
    bb = "吃得过多过饱|(有没有吃|最近吃|喜欢吃|经常进食|经常吃).*?(辣|油炸|油腻|生冷|煎炸|豆类|不容易消化的食物|夜宵)"
    cc = "(工作压力|精神压力|压力).*?(大不大|大吗)|(心情|情绪|精神).*(怎么样|怎样|如何)|(活动量|运动|锻炼).*?(大|多|少|多不多|咋样|怎么样|怎样).*?(吗|呢)"
    if re.search(aa, sentence) or re.search(bb, sentence) or re.search(cc, sentence):
        return True
    return False


def get_location(sentence):
    cc = '哪个部位|哪个位置|哪里痛|什么部位|什么位置|哪个部位|哪个位置|哪一块|那个部位痛|肚脐眼以上|描述一下位置|具体部位|具体位置'
    if re.search(cc, sentence) is not None:
        return True
    return False


def get_xingzhi(sentence):
    cc = '是哪种疼|怎么样的疼|绞痛|钝痛|隐痛|胀痛|隐隐作痛|疼痛.*性质|(性质|什么样).*(的|得)(痛|疼)'
    if re.search(cc, sentence) is not None:
        return True
    return False


def get_fan(sentence):
    cc = '(饭.*?前|吃东西前|餐前).*(疼|痛|不舒服|不适)|(饭.*?后|吃东西后|餐后).*(疼|痛|不舒服|不适)|(早上|早晨|夜里|半夜|晚饭).*(疼|痛|不舒服|不适)'
    if re.search(cc, sentence) is not None:
        aa = re.search(cc, sentence).span()
        if aa[1] - aa[0] < 20:
            return True
    return False


def get_tong_pinglv(sentence):
    cc = '持续的疼|疼一会儿会自行缓解|持续的，还是阵发|症状减轻了没|(疼|痛).*轻|现在没有症状了吗|现在还有症状吗|(一阵一阵|一直|持续).*(疼|痛)|一阵阵.*(痛|疼)|阵发性|持续性'
    if re.search(cc, sentence) is not None:
        aa = re.search(cc, sentence).span()
        return True
    return False


def get_tong(sentence):
    if get_tong_pinglv(sentence) or get_fan(sentence) or get_xingzhi(sentence):
        return True
    return False


def get_time(sentence):
    aa = "(情况|症状|痛|发病|病|感觉|疼|这样|不舒服|大约).*?(多久|多长时间|几周了？|几天了？)"
    bb = "(，|。|、|？)(多长时间了|多久了|有多久了|有多长时间了)|^(多久了|多长时间了|有多久了|有多长时间了|几天了|几周了)"
    cc = "有多长时间|有多久"
    #     match_need = "多久了？|多长时间了？|几天了？|几周了？|多久了|多长时间了|几天了|几周了"
    if re.search(aa, sentence) is not None or re.search(bb, sentence) is not None:
        return True
    return False


class KD_Metric():
    def __init__(self):
        self._pred_true = 0
        self._total_pred = 0
        self._total_true = 0
        self.norm_dict = entity_dict

    def reset(self):
        self._pred_true = 0
        self._total_pred = 0
        self._total_true = 0

    def get_metric(self, reset=False):
        rec, acc, f1 = 0., 0., 0.
        if self._total_pred > 0:
            acc = self._pred_true / self._total_pred
        if self._total_true > 0:
            rec = self._pred_true / self._total_true
        if acc > 0 and rec > 0:
            f1 = acc * rec * 2 / (acc + rec)
        if reset:
            self.reset()
        return {'rec': rec, 'acc': acc, 'f1': f1}

    def convert_sen_to_entity_set(self, sen):
        entity_set = set()
        for entity in self.norm_dict.keys():
            if entity in sen:
                entity_set.add(self.norm_dict[entity])
        if get_location(sen):
            entity_set.add('位置')
        if get_youyin(sen):
            entity_set.add('诱因')
        if get_tong(sen):
            entity_set.add('性质')
        if get_time(sen):
            entity_set.add('时长')
        return entity_set

    def __call__(
            self,
            references,  # list(list(str))
            hypothesis,  # list(list(str))
    ):
        ref = ''.join(references)
        hypo = ''.join(hypothesis)
        ref_list = self.convert_sen_to_entity_set(ref)
        hypo_list = self.convert_sen_to_entity_set(hypo)
        self._total_true += len(ref_list)
        self._total_pred += len(hypo_list)
        for entity in hypo_list:
            if entity in ref_list:
                self._pred_true += 1


def clac_sentence_metric(ground_truth, predict):
    assert len(ground_truth) == len(predict)
    kdm = KD_Metric()
    for k, sentence in enumerate(ground_truth):
        kdm(predict[k], sentence)
    kd_metric = kdm.get_metric()
    bleu_ave = get_bleu_ave(predict, ground_truth)
    pred = []
    for index in range(len(predict)):
        pred.append(" ".join(predict[index]))
    return kd_metric['f1'], bleu_ave


def test(hp, rf, l):
    submit = []
    with open(hp, "r", encoding="utf-8") as f:
        # submit = pickle.load(f)
        for line in f.readlines():
            submit.append(line.strip())
    with open(rf, "rb") as f:
        reference = pickle.load(f)
    f1, bleuave = clac_sentence_metric(reference, submit)
    print('F1:{:.4f}'.format(f1 * 100))
    print('BLEU-ave:{:.4f}'.format(bleuave * 100))
    ave = (bleuave + f1) / 2 * 100
    print('ave:{:.4f}'.format(ave))
    with open(l, "w", encoding="utf-8") as f:
        f.writelines(str(ave) + "###Submission success! F1={:.4f}, BLEU-ave={:.4f}".format(f1, bleuave))

